const drawerlistStyle = theme => ({
    list: {
        marginTop: "18px",
        paddingLeft: "0",
        paddingTop: "0",
        paddingBottom: "0",
        marginBottom: "0",
        listStyle: "none",
        position: "unset",
    },
    item: {
        position: "relative",
        display: "block",
        height: "48px",
        marginBottom: "8px",
        textDecoration: "none",
    },
    drawerButton: {
        color: "white",
        borderRadius: "5px",
        marginRight: "16px",
        marginLeft: "16px",
        width: "inherit",
        marginBottom: "8px",
        [theme.breakpoints.down("sm")]: {
            height: "36px",
        }
    },
    buttonIcon: {
        float: "left",
        textAlign: "center",
        marginRight: "10px",
    },
    buttonText: {
        paddingTop: "3px",
        fontSize: "18px",
    },
})

export default drawerlistStyle;
